import React from 'react';
import { BrowserRouter as Router,  Route } from 'react-router-dom';
import './Layout.css';
import logo from './Images/logo.png';
import home from './Images/home.png';
import search from './Images/search.png';
import chat from './Images/chat.png';
import profile from './Images/profile.png';
import dots from './Images/more.png';
import Home from './Home';
import Login from './Login';
import Search from './Search';
import Chat from './Chat';
import Profile from './Profile';
import Movie from './Movie';
import Menu from './Menu';
import { Link } from 'react-router-dom';


export default class Layout extends React.Component {

    constructor() {
        super();
        this.state = {
            page: "Home",
        };
    }
    
    
    render() {
        return (
            <Router>

                <body className="App-header">
                    <div>
                        
                        <img src={logo} className="Logo" />
                        <div>
                            <div className="ContainerT">
                                <h1 className="Title1"> Log In </h1>
                            </div>

                            <div className="ContainerU" style={{ display: "inline-flex" }}>
                                <h2 className="Title3"> Username </h2>
                                <input className="Inputus" placeholder="Type here" />
                            </div>
                            <div className="ContainerU" style={{ display: "inline-flex" }}>
                                <h2 className="Title3"> Password </h2>
                                <input className="Inputus" placeholder="Type here" />
                            </div>


                            <Link style={{ color: "black", textDecoration: "none" }} to='/ihome'>
                                <div className="ContainerH" style={{ marginBottom: "100px" }}>
                                    <h2 className="Title2"> Submit </h2>
                                </div>
                            </Link>

                        </div>
                        <div>
                            
                            <Route path="/i" exact component={Menu} />
                            <div style={{ marginLeft: "300px" }}>
                                <Route path="/" exact component={Login} />
                                
                                <Route path="/ihome"  component={Home} />
                                <Route path="/isearch" component={Search} />
                                <Route path="/ichat" component={Chat} />
                                <Route path="/iprofile" component={Profile} />
                                <Route path="/imovie" component={Movie} />
                            </div>
                        </div>

                    
                    </div>
                </body>
            </Router>

        );
    };
        

}
